func Test_isAnagram(t *testing.T) {
	type args struct {
		a string
		b string
	}
	tests := []struct {
		name string
		args args
		want bool
	}{
		{
			name: "case1",
			args: args{
				a: "abc",
				b: "bac",
			},
			want: true,
		},
		{
			name: "case2",
			args: args{
				a: "bbcc",
				b: "bcbc",
			},
			want: true,
		},
		{
			name: "case3",
			args: args{
				a: "aabbcc",
				b: "aabbc",
			},
			want: false,
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			if got := isAnagram(tt.args.a, tt.args.b); got != tt.want {
				t.Errorf("isAnagram() = %v, want %v", got, tt.want)
			}
		})
	}
}

func Test_findAnagrams(t *testing.T) {
	type args struct {
		s string
		p string
	}
	tests := []struct {
		name string
		args args
		want []int
	}{
		{
			name: "case1",
			args: args{
				s: "abab",
				p: "ab",
			},
			want: []int{0, 1, 2},
		},
		{
			name: "case2",
			args: args{
				s: "cbaebabacd",
				p: "abc",
			},
			want: []int{0, 6},
		},
		{
			name: "case3",
			args: args{
				s: "aaaaa",
				p: "aa",
			},
			want: []int{0, 1, 2, 3},
		},
		{
			name: "case4",
			args: args{
				s: "",
				p: "",
			},
			want: []int{0, 10001},
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			if got := findAnagrams(tt.args.s, tt.args.p); !reflect.DeepEqual(got, tt.want) {
				t.Errorf("findAnagrams() = %v, want %v", got, tt.want)
			}
		})
	}
}
